import { useState } from 'react'

const isAuth = true

const videos = [
	{
		name: 'Назва відео 1',
		duration: 15,
		id: 1,
	},
	{
		name: 'Назва відео 2',
		duration: 15,
		id: 2,
	},
	{
		name: 'Назва відео 3',
		duration: 212,
		id: 3,
	},
	{
		name: 'Назва відео 4',
		duration: 1123,
		id: 4,
	},
]

export function Home() {
	const [count, setCount] = useState(0)
	return (
		<>
			{videos.map(video => {
				return (
					<div key={video.id}>
						<img alt='' />
						<p>{video.name}</p>
						<p>{video.duration}</p>
						<button onClick={() => setCount(count => count + 1)}>button</button>
						<p>{count}</p>
					</div>
				)
			})}
		</>
	)
}
